"Ni√±os los llamaban y ni√±os eran en verdad. Y como quien no ha empezado a vivir, no ten√≠an miedo de nada. Consideraban a los viejos ya muertos, ya enterrados, ya acabados. La √∫nica arma que ten√≠an era la ferocidad que los cachorros de hombre a√∫n conservan. Animalitos terribles que act√∫an por instinto". Que ense√±an los dientes y aprietan los gatillos como han hecho tantas veces en los videojuegos. A los que no les importa que en las calles la gente muera de verdad bajo sus balas. Que matan y chillan con una crueldad instintiva basada en reglas internas de honor y lealtad. 
La √∫ltima novela de Roberto Saviano es salvaje y brutal. Al terminar ciertos cap√≠tulos, cerraba durante unos segundos el libro y suspiraba, asombrado por la brutalidad, por lo que puede hacer en unos ni√±os una infancia educada en la violencia. A aquellos que no hayan vivido de cerca ning√∫n tipo de violencia f√≠sica, muchas de las escenas les parecer√°n irreales, producto de una mente enferma de videojuegos y guerra. Sin embargo, conociendo a Saviano, lo m√°s probable es que todo lo que aparece en el libro haya sucedido muchas veces de una forma muy parecida, est√© sucediendo en estos momentos y vaya a seguir sucediendo en el futuro, mientras el ansia de poder y el abandono del Estado abonen las barriadas pobres de muchas ciudades para que germine y prevalezca la ley del m√°s fuerte. 
Todo el que ostenta poder sobre otras personas termina abusando de √©l. Lo hacen los pol√≠ticos que roban el dinero p√∫blico. Lo hacen los hombres que salen en manada a violar mujeres. Lo hacen los empresarios que dictan las leyes a los gobiernos. Y lo hacen, tambi√©n, todos los Maraj√°s de los extrarradios, ni√±os descontrolados que se compran una pistola y juegan a convertirse en pr√≠ncipes de la mafia. 
